import React from 'react';
import paiImage from '../images/pai.png';
import '../styles/footer.css';

const Footer = () => {
    return (
        <footer>
            <div className="footer-container">
                <div className="footer-text">
                    <h2>Personalized News</h2>
                    <p>Our mission is to provide a personalized stream of news that is interesting to you.</p>
                </div>
                <a href = "https://www.p-ai.org/" className="footer-image">
                    <img src={paiImage} alt="p-ai"/>
                </a>
            </div>
        </footer>
    );
};

export default Footer;
